import React, { useState } from "react";

// Sample account values
const accvalues = [
  { id: 1, username: "OhMama", email: "johny@gmail.com", date: "28 Jan, 12:30 AM", status: "Active" },
  { id: 2, username: "OhMuscle", email: "masku@gmail.com", date: "25 Jan, 10:40 PM", status: "Active" },
  { id: 3, username: "Alahooooo!", email: "abdul@gmail.com", date: "20 Jan, 10:40 PM", status: "Disabled" },
  { id: 4, username: "Lalalala", email: "wsmith@gmail.com", date: "15 Jan, 03:29 PM", status: "Disabled" },
  { id: 5, username: "Yeaaaahh!", email: "ESing@gmail.com", date: "14 Jan, 10:40 PM", status: "Active" },
  { id: 6, username: "sHANE", email: "johny@gmail.com", date: "28 Jan, 12:30 AM", status: "Active" },
  { id: 7, username: "ODWA", email: "masku@gmail.com", date: "25 Jan, 10:40 PM", status: "Active" },
  { id: 8, username: "lOWI!", email: "abdul@gmail.com", date: "20 Jan, 10:40 PM", status: "Disabled" },
  { id: 9, username: "Lalalala", email: "wsmith@gmail.com", date: "15 Jan, 03:29 PM", status: "Disabled" },
  { id: 10, username: "Yeaaaahh!", email: "ESing@gmail.com", date: "14 Jan, 10:40 PM", status: "Active" },
];

const DataTable = ({ setSelected }) => {
  const [searchTerm, setSearchTerm] = useState("");
  const [currentPage, setCurrentPage] = useState(1);
  const rowsPerPage = 5; // You can adjust the number of rows displayed per page

  // Filter accvalues based on the search term
  const filteredData = accvalues.filter((row) => {
    const { username, email, date, status } = row;
    return (
      username.toLowerCase().includes(searchTerm.toLowerCase()) ||
      email.toLowerCase().includes(searchTerm.toLowerCase()) ||
      date.toLowerCase().includes(searchTerm.toLowerCase()) ||
      status.toLowerCase().includes(searchTerm.toLowerCase())
    );
  });

  // Pagination
  const totalPages = Math.ceil(filteredData.length / rowsPerPage);

  return (
    <div className="overflow-x-auto w-full p-6 bg-white">
      {/* Search Bar */}
      <div className="mb-4">
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="w-full p-2 border rounded"
        />
      </div>

      <table className="min-w-full table-auto">
        <thead className="bg-white">
          <tr>
            <th className="px-4 py-2 text-center">Action</th>
            <th className="px-4 py-2 text-center">Username</th>
            <th className="px-4 py-2 text-center">Email</th>
            <th className="px-4 py-2 text-center">Date Created</th>
            <th className="px-4 py-2 text-center">Status</th>
          </tr>
        </thead>
        <tbody>
          {filteredData
            .slice((currentPage - 1) * rowsPerPage, currentPage * rowsPerPage)
            .map((row) => (
              <tr key={row.id} className="border-t">
                <td className="px-4 py-2 text-center">
                  <button onClick={() => setSelected("AdminAccount", row)} className="text-blue-500">
                    <i className="fa-solid fa-pen"></i>
                  </button>
                </td>
                <td className="px-4 py-2 text-center">{row.username}</td>
                <td className="px-4 py-2 text-center">{row.email}</td>
                <td className="px-4 py-2 text-center">{row.date}</td>
                <td className="px-4 py-2 text-center">
                  {row.status === "Active" ? (
                    <span className="text-green-500">{row.status}</span>
                  ) : (
                    <span className="text-red-500">{row.status}</span>
                  )}
                </td>
              </tr>
            ))}
        </tbody>
      </table>

      {/* Pagination */}
      <div className="flex justify-between items-center mt-4">
        <button
          onClick={() => setCurrentPage(currentPage - 1)}
          disabled={currentPage === 1}
          className={`text-blue-500 px-4 py-2 ${currentPage === 1 && "opacity-50"}`}
        >
          Previous
        </button>

        <div className="text-gray-600">
          Page {currentPage} of {totalPages}
        </div>

        <button
          onClick={() => setCurrentPage(currentPage + 1)}
          disabled={currentPage === totalPages}
          className={`text-blue-500 px-4 py-2 ${currentPage === totalPages && "opacity-50"}`}
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default DataTable;
